import React from 'react'

class Game extends React.Component {
    render() {
        return (
            <div class='Game'>
             <img src='https://img.itch.zone/aW1hZ2UvNzE1Mzg3LzM5NjQ5MzEucG5n/original/iwG3hK.png' style='height: 50%; width: 50%;' alt='Cards' />
             <p>The game board goes here</p>
            </div>
        );
    }
}
export default Game;
